import {Button, Stack, Typography} from "@mui/material";
import {AddRounded, LogoutRounded, QrCodeRounded} from "@mui/icons-material";
import {Link} from "react-router-dom";
import {observer} from "mobx-react-lite";
import {msalInstance} from "src/authConfig.ts";
import {useStore} from "src/stores";
import {UserStatus} from "src/types.ts";

const AppBar = () => {
    const {userStore: {user}, commonStore: {setToken}} = useStore();
    const handleLogout = () => {
        msalInstance.clearCache().catch(e => console.error(e));
        setToken(undefined);
        window.location.reload();
    };

    return (
        <Stack direction='row' alignItems='center' p={2.5} spacing={2}>
            <Stack direction='row' alignItems='center' flexGrow={1}>
                <QrCodeRounded sx={{width: 56, height: 56}} htmlColor={'#4377A7'}/>
                <Typography variant='h3' fontWeight={500} className={'appbar-text'}>ĐiểmDanhTrựcTuyến</Typography>
                <svg width="188" height="156" viewBox="0 0 188 156" fill="none" xmlns="http://www.w3.org/2000/svg"
                     xmlnsXlink="http://www.w3.org/1999/xlink">
                    <rect width="188" height="156" fill="url(#pattern0)"/>
                    <defs>
                        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                            <use xlinkHref="#image0_2_93" transform="scale(0.00531915 0.00641026)"/>
                        </pattern>
                        <image id="image0_2_93" width="188" height="156"
                               xlinkHref="data:image/png;base64,"/>
                    </defs>
                </svg>
            </Stack>

            {!!user && user.status === UserStatus.Active &&
                <>
                    <Link to={'/subject/create'}>
                        <Button variant="contained" color="primary" startIcon={<AddRounded/>}>Nhập môn học mới</Button>
                    </Link>
                    <Button variant="contained" color="primary" endIcon={<LogoutRounded/>} onClick={handleLogout}>Đăng
                        xuất</Button>
                </>
            }
        </Stack>
    )
};
export default observer(AppBar);